    false,nt"url": null,nt"notes": "This annual narrative report for Windom
    Wetland Management District summarizes activities during the 1999 fiscal year.  The
    report begins with an introduction to the District and a summary of the yearu2019s
    highlights, personnel, and climatic conditions.  Information about monitoring and
    studies- including surveys and censuses- is provided next.  Habitat restoration
    and management projects are also covered; activities include water level management,
    fire management, and vegetation control.  Fish and wildlife management is discussed
    next with emphasis on disease monitoring and nest structures.  Coordination activities,
    such as interagency coordination, private land activities, and cooperative organizations,
    are outlined.  The resource protection section provides information about law enforcement,
    permits, cultural resource management, land acquisition support, threats, and conflicts.
     Information about public education and recreation is given.  Finally, District
    planning and administration- including comprehensive conservation planning and general
    administration- are discussed; brochures are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
